import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
class CardDefine extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      cardValue: this.props.cardValue
    };
  }
  render() {
    return (
      <div>
        <Card
          style={{
            width: 100,
            margin: 25,
            fontFamily: "'Roboto",
            backgroundColor: "#1C80B5",
            color: "#999794"
          }}
        >
          <CardContent>
            <h1>{this.state.cardValue}</h1>
          </CardContent>
        </Card>
      </div>
    );
  }
}

export default CardDefine;
